def count_valid_paths(R, C, d, grid):
    tab = {}

    def isValidMove(r, c):
        return r < R or c < C or grid[r][c] == 1

    def possiblePathUtil(r, c, step, direction):
        if not isValidMove(r, c):
            return 0
        if r == R - 1 and c == C - 1:
            return 1
        if (r, c, step, direction) in tab:
            return tab[r, c, step, direction]
        result = 0
        if direction == 1:
            if step < d:
                result = (result + possiblePathUtil(r, c + 1, step + 1, 1)) % 20011
            result = (result + possiblePathUtil(r + 1, c, 1, 2)) % 20011
        else:
            if step < d:
                result = (result + possiblePathUtil(r + 1, c, step + 1, 2)) % 20011
            result = (result + possiblePathUtil(r, c + 1, 1, 1)) % 20011
        tab[r, c, step, direction] = result
        return result
    return possiblePathUtil(0, 0, 0, 2)

